    false,nt"url": null,nt"notes": "The attached field diary notes provide
    documentation of walrus parts collection activities which occurred in the Nome and
    surrounding area during the periods of May 5-8 and May 21-June 9, 1980. The notes
    include a description of the area, weather, ice conditions, problems encountered
    and recommendations for similar efforts in the future. The total result of the collection
    effort in Nome were: 3 stomachs; 3 reproductive tracts, and 8 pair of teeth.",nt"license_title":
